import Header from "./Header"
import FileIcons from './components/FileIcons';
import FileUpload from './components/FileUpload';

function Home() {
  return (
    <div>
      <Header />
      <div className="body">
        <FileUpload />
        <FileIcons />
      </div>
    </div>
  )
}

export default Home;
